import React from "react";

function Component() {
  return (
    <div className="formContainer">
      <input className="inputs" type="email" />
      <input className="inputs" type="password" />
      <input className="inputs" type="password" />
      <button>Sign Up</button>
    </div>
  );
}

export default Component;
